    false,nt"url": null,nt"notes": "In response to a change in Stillwater NWR
    Complex purposes, an analysis was performed to evaluate potential impacts to endangered
    species and Newlands Project Operations. Analyses were performed using the Below
    Lahontan Reservoir (BLR) Model which is linked to the Truckee River Operations Model
    and Cui-ui population index (HAB14) subroutine to evaluate effects to Truckee River
    resources. Flow data, control files, input files, Ft. Churchill files, BLR model
    outputs, TROM outputs, and HAB14 outputs are provided in the appendices.",nt"license_title":
